  return (
    <Fragment>
      <main className="container">
        <div className="row">
          <div className="col">
            <Banner />
            <section className="top-sales">
              <h2 className="text-center">Хиты продаж!</h2>

              <div className="preloader">
                <span></span>
                <span></span>
                <span></span>
                <span></span>
              </div>
            </section>

            <section className="catalog">
              <h2 className="text-center">Каталог</h2>

              <div className="preloader">
                <span></span>
                <span></span>
                <span></span>
                <span></span>
              </div>
            </section>
          </div>
        </div>
      </main>

      <Footer />
    </Fragment>
  );
};

export default Home;
